webpackJsonp([0xfe796d9076c4],{654:function(e,n){e.exports={data:{markdownRemark:{html:'<p>Gatsby uses a React component to server render the <code>&#x3C;head></code> and other parts of\nthe HTML outside of the core Gatsby application.</p>\n<p>Most sites should use the default <code>html.js</code> shipped with Gatsby. But if you need\nto customize your site’s html.js, copy the default one into your source\ntree by running:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>cp .cache/default-html.js src/html.js</code></pre>\n      </div>\n<p>And then making modifications as needed.</p>\n<h3 id="required-props"><a href="#required-props" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Required props</h3>\n<p>Note: the various props that are rendered into pages <em>are</em> required e.g.\n<code>headComponents</code>, <code>preBodyComponents</code>, <code>body</code>, and <code>postBodyComponents</code>.</p>\n<h3 id="react-helmet"><a href="#react-helmet" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>React Helmet</h3>\n<p>Also anything you render in the <code>html.js</code> component will <em>not</em> be made “live” in\nthe client like other components. If you want to dynamically update your\n<code>&#x3C;head></code> we recommend using\n<a href="/packages/gatsby-plugin-react-helmet/">React Helmet</a></p>\n<h3 id="target-container"><a href="#target-container" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Target container</h3>\n<p>If you see this error: <code>Uncaught Error: _registerComponent(...): Target container is not a DOM element.</code> it means your <code>html.js</code> is missing the required\n“target container”. Inside your <code>&#x3C;body></code> you must have a div with an id of\n<code>___gatsby</code> like:</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsx"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span>\n  <span class="token attr-name">key</span><span class="token script language-javascript"><span class="token punctuation">=</span><span class="token punctuation">{</span><span class="token template-string"><span class="token string">`body`</span></span><span class="token punctuation">}</span></span>\n  <span class="token attr-name">id</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>___gatsby<span class="token punctuation">"</span></span>\n  <span class="token attr-name">dangerouslySetInnerHTML</span><span class="token script language-javascript"><span class="token punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">{</span> __html<span class="token punctuation">:</span> <span class="token keyword">this</span><span class="token punctuation">.</span>props<span class="token punctuation">.</span>body <span class="token punctuation">}</span><span class="token punctuation">}</span></span>\n<span class="token punctuation">/></span></span>\n</code></pre>\n      </div>',excerpt:"Gatsby uses a React component to server render the  <head>  and other parts of\nthe HTML outside of the core Gatsby application. Most sites…",timeToRead:1,frontmatter:{title:"Customizing html.js"},parent:{__typename:"File",relativePath:"docs/custom-html.md"}}},pathContext:{slug:"/docs/custom-html/"}}}});
